import React from 'react';
import { Link } from "react-router-dom";
import '../Styles/Card.css'

export default function Card({image, name, continent, id}) {

  return (

      <Link to={`/detail/${id}`}>
    <div className='cards'>

      <h3>{name}</h3>

      <img src={image} alt='Not flag' width='150px' height='100px'/>

      <h3>{continent}</h3>

    </div>
      </Link>
  )
};
